// src/Components/AdminDashboard.js
import React, { useEffect, useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { Container, Table, Input } from "reactstrap";
import { fetchBooks } from "../Features/BookSlice";
import { fetchAllBorrowedBooks } from "../Features/BorrowedBookModelSlice";

const AdminDashboard = () => {
  const dispatch = useDispatch();

  const { books, isLoading: booksLoading, isError: booksError } = useSelector((state) => state.books);
  const { borrowedBooks, loading: borrowedLoading, error: borrowedError } = useSelector((state) => state.borrowed);

  const [search, setSearch] = useState("");

  useEffect(() => {
    dispatch(fetchBooks());
    dispatch(fetchAllBorrowedBooks());
  }, [dispatch]);

  // ðŸ”¹ Filter borrowed books by student or book title
  const filtered = borrowedBooks.filter((b) => {
    if (!b.studentUsername || !b.book?.title) return false;
    const s = search.toLowerCase();
    return (
      b.studentUsername.toLowerCase().includes(s) ||
      b.book.title.toLowerCase().includes(s)
    );
  });

  return (
    <Container className="py-4">
      <h2 className="mb-4">Admin Dashboard</h2>

      {/* Statistics */}
      <div style={{ display: "flex", gap: "20px", marginBottom: "30px" }}>
        <div style={{ backgroundColor: "#f0f0f0", padding: "20px", borderRadius: "10px", textAlign: "center", minWidth: "150px" }}>
          <h5>Total Books</h5>
          {booksLoading ? <h2>Loading...</h2> : booksError ? <h2>Error</h2> : <h2>{books.length}</h2>}
        </div>

        <div style={{ backgroundColor: "#f0f0f0", padding: "20px", borderRadius: "10px", textAlign: "center", minWidth: "150px" }}>
          <h5>Borrowed Books</h5>
          {borrowedLoading ? <h2>Loading...</h2> : borrowedError ? <h2>Error</h2> : <h2>{borrowedBooks.length}</h2>}
        </div>
      </div>

      {/* Search */}
      <Input
        type="text"
        placeholder="Search by student or book title..."
        value={search}
        onChange={(e) => setSearch(e.target.value)}
        className="mb-3"
      />

      {/* Borrowed Books Table */}
      {borrowedLoading ? (
        <p>Loading borrowed books...</p>
      ) : borrowedError ? (
        <p>Error: {borrowedError}</p>
      ) : borrowedBooks.length === 0 ? (
        <p>No borrowed books found.</p>
      ) : (
        <Table striped bordered hover responsive>
          <thead>
            <tr>
              <th>Student</th>
              <th>Book Title</th>
              <th>Author</th>
              <th>Year</th>
              <th>Borrowed At</th>
              <th>Returned At</th>
              <th>Rating</th>
              <th>Feedback</th>
            </tr>
          </thead>
          <tbody>
            {filtered.map((b) => (
              <tr key={b._id}>
                <td>{b.studentUsername}</td>
                <td>{b.book?.title || "N/A"}</td>
                <td>{b.book?.author || "N/A"}</td>
                <td>{b.book?.year || "N/A"}</td>
                <td>{new Date(b.borrowedAt).toLocaleDateString()}</td>
                <td>{b.returnedAt ? new Date(b.returnedAt).toLocaleDateString() : "-"}</td>
                <td>{b.rating}</td>
                <td>{b.feedback}</td>
              </tr>
            ))}
          </tbody>
        </Table>
      )}
    </Container>
  );
};

export default AdminDashboard;
